    "post_date": "2019-05-15 20:57:34",
    "post_date_gmt": "2019-05-15 17:57:34",
    "post_content": "<!-- wp:paragraph -->\n<p><strong>\u041a\u043e\u0431\u0430\u043b\u044c\u0442 \u0445\u0440\u043e\u043c - \u0424\u0438\u0440\u043c\u0430 MESA.<\/strong><\/p>\n<!-- \/wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>\n\n\u0414\u0438\u0441\u043a \u0438\u0437 \u0441\u043f\u043b\u0430\u0432\u0430 <em>\"Magnum Splendidum\"<\/em> \u0434\u043b\u044f \u043a\u0435\u0440\u0430\u043c\u0438\u043a\u0438 (\u043a\u043e\u0440\u043e\u043d\u043e\u043a \u0438 \u043c\u043e\u0441\u0442\u043e\u0432), \u043a\u043e\u0431\u0430\u043b\u044c\u0442-\u0445\u0440\u043e\u043c\u043e\u0432\u044b\u0439 \u0441\u043f\u043b\u0430\u0432 \u0431\u0435\u0437 \u0441\u043e\u0434\u0435\u0440\u0436\u0430\u043d\u0438\u044f \u0431\u0435\u0440\u0438\u043b\u043b\u0438\u044f, <strong>Co<\/strong> (60%), <strong>Cr <\/strong>(28%), <strong>W<\/strong> (9%), <strong>Si<\/strong> (1,5%), \u0442\u0432\u0435\u0440\u0434\u043e\u0441\u0442\u044c <em>273HV \u041a\u0422\u0420<\/em> \u043f\u0440\u0438 \u0442\u0435\u043c\u043f\u0435\u0440\u0430\u0442\u0443\u0440\u0435 <em>25-500\u00b0C 14,2, 25-600\u00b0C 14.4. <\/em><\/p>\n<!-- \/wp:paragraph -->",
