    "post_content": "<!-- wp:paragraph -->\n<p>\u041f\u043e\u0441\u0442\u0435\u043f\u0435\u043d\u043d\u0430\u044f \u0442\u0432\u0435\u0440\u0434\u043e\u0441\u0442\u044c \u0438 \u043f\u043e\u0441\u0442\u0435\u043f\u0435\u043d\u043d\u0430\u044f \u043f\u043e\u043b\u0443\u043f\u0440\u043e\u0437\u0440\u0430\u0447\u043d\u043e\u0441\u0442\u044c \u0438 \u043f\u043e\u0441\u0442\u0435\u043f\u0435\u043d\u043d\u044b\u0439 \u0446\u0432\u0435\u0442. 3D-\u043c\u0443\u043b\u044c\u0442\u0438\u0441\u043b\u043e\u0439 \u0440\u0435\u0430\u043b\u0438\u0437\u0443\u0435\u0442 \u0435\u0441\u0442\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0433\u0440\u0430\u0434\u0438\u0435\u043d\u0442 \u0446\u0432\u0435\u0442\u0430, \u0433\u0440\u0430\u0434\u0438\u0435\u043d\u0442 \u043f\u043e\u043b\u0443\u043f\u0440\u043e\u0437\u0440\u0430\u0447\u043d\u043e\u0441\u0442\u0438 \u0438 \u0433\u0440\u0430\u0434\u0438\u0435\u043d\u0442\u0430 \u0441\u0438\u043b\u044b \u0432 \u0440\u0435\u0430\u043b\u044c\u043d\u043e\u043c \u0441\u043c\u044b\u0441\u043b\u0435, \u0434\u043e\u0431\u0438\u0432\u0430\u044f\u0441\u044c \u043e\u0447\u0435\u0440\u0435\u0434\u043d\u043e\u0439 \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u0438 \u0432 \u0441\u0442\u043e\u043c\u0430\u0442\u043e\u043b\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u043e\u043c \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b\u0435 \u0438 \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u043e\u043d\u0438\u0437\u0438\u0440\u0443\u044f \u0441\u0442\u043e\u043c\u0430\u0442\u043e\u043b\u043e\u0433\u0438\u044e \u0435\u0449\u0435 \u0440\u0430\u0437! <\/p>\n<!-- \/wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>3D-\u0433\u0440\u0430\u0434\u0438\u0435\u043d\u0442:<\/strong> \u0426\u0432\u0435\u0442\u043e\u0432\u043e\u0439 \u0433\u0440\u0430\u0434\u0438\u0435\u043d\u0442 6 \u0441\u043b\u043e\u0435\u0432 \u0435\u0441\u0442\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u043f\u0435\u0440\u0435\u0445\u043e\u0434\u0430 \u0446\u0432\u0435\u0442\u0430, \u0441\u043e\u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0443\u044e\u0449\u0438\u0439 \u0433\u0440\u0430\u0434\u0438\u0435\u043d\u0442 \u0446\u0432\u0435\u0442\u0430 \u0435\u0441\u0442\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u0437\u0443\u0431\u0430 \u043e\u0442 \u0446\u0435\u0440\u0432\u0438\u043a\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u0434\u043e \u0440\u0435\u0436\u0443\u0449\u0435\u0433\u043e \u043a\u0440\u0430\u044f. <\/p>\n<!-- \/wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>\u041f\u0440\u043e\u0437\u0440\u0430\u0447\u043d\u043e\u0441\u0442\u044c: <\/strong>\u041f\u0440\u043e\u0437\u0440\u0430\u0447\u043d\u043e\u0441\u0442\u044c \u043e\u0442 57% \u0432 \u0440\u0435\u0436\u0443\u0449\u0435\u043c \u0437\u0443\u0431\u0435 \u0434\u043e 43% \u0432 \u0446\u0435\u0440\u0432\u0438\u043a\u0430\u043b\u044c\u043d\u043e\u043c. \u042d\u0442\u043e \u043f\u043e\u043a\u0430\u0437\u044b\u0432\u0430\u0435\u0442 \u0443\u043c\u0435\u043d\u044c\u0448\u0435\u043d\u0438\u0435 \u0433\u0440\u0430\u0434\u0438\u0435\u043d\u0442\u0430, \u0434\u043e\u0441\u0442\u0438\u0436\u0435\u043d\u0438\u0435 \u0436\u0438\u0432\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0439 \u043f\u0440\u043e\u0437\u0440\u0430\u0447\u043d\u043e\u0441\u0442\u0438 \u0435\u0441\u0442\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0437\u0443\u0431\u043d\u043e\u0439 \u044d\u043c\u0430\u043b\u0438, \u0432 \u0442\u043e \u0432\u0440\u0435\u043c\u044f \u043a\u0430\u043a \u043d\u0438\u0437\u043a\u0430\u044f \u043f\u0440\u043e\u0437\u0440\u0430\u0447\u043d\u043e\u0441\u0442\u044c \u0432 \u0448\u0435\u0439\u043a\u0435  \u0438\u043c\u0435\u0435\u0442 \u044d\u0444\u0444\u0435\u043a\u0442\u0438\u0432\u043d\u044b\u0439 \u043d\u0435\u043f\u0440\u043e\u0437\u0440\u0430\u0447\u043d\u044b\u0439! <\/p>\n<!-- \/wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>\u0413\u0440\u0430\u0434\u0438\u0435\u043d\u0442 \u0441\u0438\u043b\u044b: <\/strong>\u0413\u0440\u0430\u0434\u0438\u0435\u043d\u0442 \u0441\u0438\u043b\u044b \u043e\u0442 600 \u041c\u043f\u0430 \u0434\u043e 900 \u041c\u043f\u0430. \u041e\u043d \u043e\u0431\u043b\u0430\u0434\u0430\u0435\u0442 \u043d\u0438\u0437\u043a\u043e\u0439 \u043f\u0440\u043e\u0447\u043d\u043e\u0441\u0442\u044c\u044e \u043f\u0440\u0438 \u043e\u043a\u043a\u043b\u044e\u0437\u0438\u0438 \u0438 \u043d\u0435 \u043f\u0440\u0438\u0447\u0438\u043d\u044f\u0435\u0442 \u0432\u0440\u0435\u0434\u0430 \u043f\u0440\u043e\u0442\u0438\u0432\u043e\u0441\u0442\u043e\u044f\u0449\u0435\u0439 \u044d\u043c\u0430\u043b\u0438. \u0412\u044b\u0441\u043e\u043a\u0430\u044f \u043f\u0440\u043e\u0447\u043d\u043e\u0441\u0442\u044c \u0432 \u0431\u0430\u0437\u043e\u0432\u043e\u0439 \u0447\u0430\u0441\u0442\u0438. <\/p>\n<!-- \/wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>\u041f\u0440\u0435\u0434\u0435\u043b \u043f\u0440\u043e\u0447\u043d\u043e\u0441\u0442\u0438 \u043f\u0440\u0438 \u0438\u0437\u0433\u0438\u0431\u0435.<\/p>\n<!-- \/wp:paragraph -->",
