    "post_content": "<!-- wp:paragraph -->\n<p><\/p>\n<!-- \/wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>\u041c\u043e\u0441\u0442\u043e\u0432\u0438\u0434\u043d\u044b\u0435 \u043f\u0440\u043e\u0442\u0435\u0437\u044b \u0438 \u043f\u0440\u043e\u0442\u0435\u0437\u044b \u043d\u0430 \u0438\u043c\u043f\u043b\u0430\u043d\u0442\u0430\u0442\u0430\u0445, \u0438\u0437\u0433\u043e\u0442\u043e\u0432\u043b\u0435\u043d\u043d\u044b\u0435 \u0438\u0437 \u0434\u0438\u043e\u043a\u0441\u0438\u0434\u0430 \u0446\u0438\u0440\u043a\u043e\u043d\u0438\u044f \u0432 \u0443\u0441\u043b\u043e\u0432\u0438\u044f\u0445 \u0447\u0430\u0441\u0442\u044b\u0445  \u043d\u0430\u0433\u0440\u0443\u0437\u043e\u043a \u2014 \u044d\u0442\u043e \u0433\u0430\u0440\u0430\u043d\u0442 \u0431\u0435\u0437\u043e\u043f\u0430\u0441\u043d\u043e\u0441\u0442\u0438 \u0438 \u043d\u0430\u0434\u0435\u0436\u043d\u043e\u0441\u0442\u0438. \u041f\u0440\u043e\u0447\u043d\u043e\u0441\u0442\u044c <em>1200 \u043c\u041f\u0430<\/em>. \u0414\u043b\u044f \u043e\u043a\u0440\u0430\u0448\u0438\u0432\u0430\u043d\u0438\u044f \u0441\u044b\u0440\u043e\u0433\u043e \u0438\u0437 ZrO2 \u043a\u0430\u0440\u043a\u0430\u0441\u043e\u0432 \u0438 \u043f\u043e\u043b\u043d\u043e\u0439 \u0430\u043d\u0430\u0442\u043e\u043c\u0438\u0438 \u043f\u043e \u0442\u0435\u0445\u043d\u043e\u043b\u043e\u0433\u0438\u0438 <strong>Prettau <\/strong>\u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u044e\u0442\u0441\u044f \u043d\u0435\u043c\u0435\u0446\u043a\u0438\u0435 \u043a\u0440\u0430\u0441\u043a\u0438  <strong>ZirkonZahn<\/strong>.<\/p>\n<!-- \/wp:paragraph -->",
